{"1": ["Прислали не те, что на фото, опять закругленный верх, фианитов 4 шт, а не 5 шт как на фото и вес естественно меньше, чем заявлено минимальный. Милые конечно, но на фото лучше. На взрослое ухо с небольшой мочкой будут нормально.", "2018-09-05T14:04:41.431168752Z", "золотистый", "0", 10, 0, 5, "Серьги", "SOKOLOV"], "2": ["Да, на фото серьги немного другие, с пятью фианитами! Но эти тоже очень красивые) Нам очень понравились! Заказывали несколько пар на выбор. Смотрятся очень лаконично, аккуратно! Серьги детские, не крошечные (уж поверьте, мы видели еще меньше). Даже на моем ухе выглядят достойно)))\n4 звезды за несоответствие фото! Вайлдберрис уж измените наконец то его на соответствующее))))", "2018-04-13T11:24:29.54+03:00", "золотистый", "0", 18, 1, 4, "Серьги", "SOKOLOV"], "3": ["вроде бы пришли,как на картинке,но что-то смотрятся не очень", "2018-03-02T11:43:57.055+03:00", "золотистый", "0", 1, 2, 4, "Серьги", "SOKOLOV"], "4": ["Привезли не те серьги. С 4 фианитами и округлым верхом. Смотрятся иначе! Мне не понравились. Курьер указал неверное вложение, но как часто бывает в последнее время, заказ оформили как возврат! \r\nРассмотрите пожалуйста внимательно данную модель!!!", "2017-09-03T11:13:48.118+03:00", "золотистый", "0", 4, 2, 1, "Серьги", "SOKOLOV"], "5": ["Серьги с браком, плохо работает замок, ели открыли , одели и не снять , сняли с кровью и слезами, требую оформить возврат", "2015-12-22T19:53:07+03:00", "золотистый", "0", 12, 3, 1, "Серьги", "SOKOLOV"], "6": ["Пломба не нарушена", "2015-12-22T19:54:48+03:00", "золотистый", "0", 0, 4, 1, "Серьги", "SOKOLOV"], "7": ["Привезли неверное вложение. На фото на сайте выложен заводской арт. серег Sokolov 026484 (где фианитов 5 шт. в серьге), а привезли заводской арт. Sokolov 026485 (где фианитов 4 шт. в серьге). Серьги похожи, но разная геометрия в верхней части и вид сбоку (одни закрывают прокол в ухе, другие нет)", "2015-09-28T11:17:18+03:00", "золотистый", "0", 23, 1, 1, "Серьги", "SOKOLOV"], "8": ["Кроме того, на сайте WB выложены 2 разных артикула с одинаковыми фото: это данный артикул 2275851 и артикул 2275850. По сему прошу заказ № 143596869 исключить из расчета моего % выкупа. Отказ по причине неверного вложения.", "2015-09-28T11:20:38+03:00", "золотистый", "0", 14, 0, 1, "Серьги", "SOKOLOV"], "9": ["Для покупателей: серьги весом 1,3 гр. Микроскопичные (детская коллекция Sokolov), подойдут на невысокий прокол и тонкую (нам в 3,5 года не подошли) мочку. Дороже 3 т.р. не стоят. На каждой серьге по 4 фианита в виде дорожки, не 5, а 4 !!!", "2015-09-28T11:22:53+03:00", "золотистый", "0", 26, 2, 1, "Серьги", "SOKOLOV"]}
